const EnableDark = () => {
    alert("Amazing Vaibhav")
  };

function Darkmode() {
  return (
    <div>
    <button className="dark-mode" onClick={EnableDark}>
    Darkmode
    </button>
    </div>
  )
}

export default Darkmode
